#Guardar en variable
plotdata <- Marriage %>%
  count(race)

ggplot(plotdata,
       aes(x=reorder(race, n),
           y=n))+
  geom_bar(stat= "identity",
           fill="cornflowerblue")+
  labs(x="Raza",
       y="Frecuencia",
       title="Participantes por Raza")

ggplot(plotdata,
       aes(x=reorder(race, -n),
           y=n))+
  geom_bar(stat="identity",
           fill="cornflowerblue")+
  geom_text(aes(label= n),
            vjust= -0.5)+
  labs(x="Raza",
       y="Frecuencia",
       title="Participantes por Raza")

#Mutate:

plotdata <- Marriage %>%
  count(race) %>%
  mutate(pct = n / sum(n),
         pctlabel = paste0(round(pct*100), "%"))

"""![image.png](data:image/png;base64,)"""

ggplot(plotdata,
       aes(x=reorder(race, -pct),
           y=pct))+
  geom_bar(stat="identity",
           fill="indianred3")+
  geom_text(aes(label= pctlabel),
            vjust = -0.25)+
  scale_y_continuous(labels = scales::percent)+
  labs(x="Raza",
       y="Frecuencia",
       title="Participantes por Raza")

ggplot(Marriage, aes(x= officialTitle))+
  geom_bar()+
  labs(x= "oficial",
       y= "Frecuencia",
       title= "Matrimonios oficiales")

#Girar grafico
ggplot(Marriage, aes(x= officialTitle))+
  geom_bar()+
  labs(x= "oficial",
       y= "Frecuencia",
       title= "Matrimonios oficiales")

#Girar texto
ggplot(Marriage, aes(x= officialTitle))+
  geom_bar()+
  labs(x= "oficial",
       y= "Frecuencia",
       title= "Matrimonios oficiales")+
  theme(axis.text.x = element_text(angle = 45,
                                   hjust = 1))

#Crear proporciones
plotdata <- Marriage %>%
  count(race) %>%
  arrange(desc(race)) %>%
  mutate(prop = round(n*100 /sum(n),1),
         lab.ypos = cumsum(prop)-0.5*prop)

#Ver datos
print(plotdata)

ggplot(plotdata,
       aes(x="",
           y= prop,
           fill= race))+
  geom_bar(width = 1,
           stat = "identity",
           color= "black")+
  coord_polar("y",
              start = 0,
              direction = -1)+
  theme_void()

#Create new variable
plotdata$label <- paste0(plotdata$race, "\n",
                         round(plotdata$prop), "%")

print(plotdata)

ggplot(plotdata,
       aes(x="",
           y= prop,
           fill= race))+
  geom_bar(width = 1,
           stat = "identity",
           color= "black")+
  geom_text(aes(y= lab.ypos, label = label),
            color= "black")+
  coord_polar("y",
              start = 0,
              direction = -1)+
  theme_void()+
  theme(legend.position = "FALSE")+
  labs(title= "Participacion por Raza")

#Mapa de Arboles
install.packages("treemapify")

library(treemapify)

plotdata <- Marriage %>%
  count(officialTitle)

ggplot(plotdata,
       aes(fill= officialTitle,
       area = n))+
  geom_treemap()+
  labs(title = "Matrimonios oficiales")

