#L√≠nea de tendencia lineal
ggplot(Salaries,
       aes(x = yrs.since.phd,
           y = salary))+
  geom_point(color = "cornflowerblue",
             size = 2,
             alpha = 0.8)+
  geom_smooth(method = "lm")+
  scale_y_continuous(label = scales::dollar,
                     limits = c(50000, 250000))+
  scale_x_continuous(breaks = seq(0, 60, 10),
                     limits = c(0, 60))+
  labs(x = "A√±os desde PhD",
       y = "",
       title = "Experience VS. Salary",
       subtitle = "Salary for 2022")

##L√≠nea de tendencia polin√≥mica 2do grado
ggplot(Salaries,
       aes(x = yrs.since.phd,
           y = salary))+
  geom_point(color = "cornflowerblue",
             size = 2,
             alpha = 0.8)+
  geom_smooth(method = "lm", se = FALSE,
              formula = y~poly(x,5),
              color = "indianred3")+
  scale_y_continuous(label = scales::dollar,
                     limits = c(50000, 250000))+
  scale_x_continuous(breaks = seq(0, 60, 10),
                     limits = c(0, 60))+
  labs(x = "A√±os desde PhD",
       y = "",
       title = "Experience VS. Salary",
       subtitle = "Salary for 2022")

